	Городец &mdash; одно из древнейших русских поселений на Средней Волге, основан во 2-й половине XII века. По одним данным, он был основан в 1152 году Юрием Долгоруким[4], по другим &mdash; в 1172 году. Городе́ц &mdash; город районного значения в Нижегородской области России, административный центр Городецкого района.

	
		Город расположен на левом берегу Волги, в 53 км выше Нижнего Новгорода и в 14 км к востоку от железнодорожной станции Заволжье (конечная станция электрифицированной ветки от Нижнего Новгорода, Нижегородской ГЭС).

	
		&nbsp;

	
		Экскурсионные программы

	
		&nbsp;

	
		&nbsp;

	
		Дубна &mdash; город полный очарования. Здесь прекрасно сохранены главные достопримечательности &mdash; исторические здания, извилистые романтичные улицы и притягательные скверы. Первая достопримечательность Дубны, о которую надо посмотреть&ndash; самый большой в мире памятник Ленину, расположенный на берегу канала им. Москвы. Высота этого памятника &nbsp; достигает 37м. На противоположном берегу в 1935г. был установлен памятник Сталину.&nbsp; Его постамент остался&nbsp; там до сих пор. Не менее впечатляющим объектом является&nbsp;плотина, воздвигнутая на реке Волге,&nbsp;в результате чего на карте появилось так называемое Московское море (Иваньковское водохранилище).Также стоит увидеть известный всем&nbsp;&nbsp;гигантский 10-метровый стул, установленный компанией &laquo;Экомебель&raquo;&nbsp; в подарок ко Дню города.&nbsp; &nbsp;Дубна является единственным российским городом, увековеченным в периодической таблице элементов Менделеева:&nbsp;Дубний&nbsp;&ndash; так называется, открытый учеными города,&nbsp;105&ndash;й химический элемент. В городе большое количество памятников известным ученым физикам, самолетам ИЛ-2 и МИГ-25, а также памятник В.Высоцкому.

	
		В Дубне большое количество православных храмов имеющих историческое значение, а также воздвигнутых вновь. Особенно выделяется&nbsp;деревянный Храм Смоленской иконы Божией Матери, расположенный в лесном бору и скорее напоминающий древний скит. Сейчас при храме действует гимназия и иконописная школа.

	
		&nbsp;

	
		Экскурсионные программы



	&nbsp;

	Казань &ndash; столица Республики Татарстан - один из крупных экономических, научных, культурных центров и древних городов нашей страны. Расположена на большой реке Волге.&nbsp;Город, который вырос на границе двух миров &ndash; Европы и Запада - и вобрал в себя традиции двух великих культур. Бывшая столица Казанского ханства недавно отпраздновала свое тысячелетие.&nbsp;Красота и величие древних соборов и мечетей подчеркнута неоном и сверкающим стеклом, а старинные особняки, где некогда гремели шумные балы, соседствуют с ультрасовременными зданиями в стиле хай-тек.


	&nbsp;


	Экскурсионные программы
	&nbsp;

	&nbsp;Калязин

	
		Город, ушедший под воду, можно сравнить с легендарным Градом-Китежем, поскольку современный Калязин лишь малая часть Калязина исторического, поглощенного водами Угличского водохранилища. От стоявшего на центральной площади Никольского собора в настоящее время осталась только колокольня, впрочем ставшая самой известной достопримечательностью не только Калязина, но и всего участка Волги от Дубны до Углича. Сейчас город невелик, но когда-то это был крупный торговый и монастырский центр на северо-западных границах Московии.

	
		Калязин &ndash; один из старинных городов Тверской земли, выросших на Волге, где стоит знаменитая затопленная колокольня Николаевского собора.&nbsp;

	
		&nbsp;

	
		Экскурсионные программы



	&nbsp;

	&nbsp;&nbsp;&nbsp; Касимов - один из древнейших городов Рязанского края, богатый памятниками национальной культуры. Он включен в число городов - исторических памятников.


	&nbsp;


	Экскурсионные программы

	
		Ки́жи (карельск.Kiži)&nbsp;&mdash; островна Онежском озерев Карелии, на котором расположен всемирно известный архитектурный ансамбль Кижского погоста, состоящий из двух церквей и колокольни XVIII&mdash;XIX веков, окруженных единой оградой&nbsp;&mdash; реконструкцией традиционных оград погостов. 1 января 1966 года на базе архитектурного ансамбля Кижского погоста был основан Государственный историко-архитектурный музей &laquo;Кижи&raquo;. Куда помимо существующих на своих первоначальных местах построек было свезено большое количество часовен, домов и хозяйственных построек из Заонежья и других регионов Карелии. По одной из легенд, Преображенская церковь построена одним топором, который потом мастер выбросил в озеро.

	
		На острове также расположены несколько деревень, которые вместе составляют населённый пункт Кижи, входящий в состав Великогубского сельского поселения Медвежьегорского района (до 2004 года административно относился к городу Петрозаводску).

	
		В 1990 году Кижский погост вошёл в Список Всемирного наследия ЮНЕСКО, в 1993&nbsp;году указом Президента Российской Федерации архитектурное собрание музея под открытым небомвключено в Государственный свод особо ценных объектов культурного наследия народов России.

	
		&nbsp;

	
		Экскурсионные программы



	&nbsp;

	&nbsp;&nbsp;&nbsp; Коломна &ndash; один из древнейших городов Подмосковья. Сохранившиеся до наших дней кремлевские башни, здания церквей и соборов, шпили колоколен, усадебные застройки создают неповторимый колорит русского провинциального города.&nbsp;


	&nbsp;


	Экскурсионные программы

	
		Новая &laquo;зеленая стоянка&raquo; на берегу Рыбинского водохранилища &laquo;Ярославское взморье&raquo; Природа &laquo;Ярославского взморья&raquo; &mdash; одна из его основных ценностей. Бескрайние просторы акватории Рыбинского моря, живописные бухты в обрамлении песчаных пляжей, красота столетних сосен и елей &ndash; все это поражает воображение уставшего от суеты горожанина. Величественная природа центральной России предстает здесь во всем своем великолепии.

		
			На стоянке организован прокат спортивного инвентаря, взрослых и детских велосипедов, роликовых коньков, электромобилей.

		
			Есть частный мини-зоопарк (страусы, северный олень, барашки, козлики, овцы, верблюд, лама). Рядом&nbsp;чистый лес с грибами, оборудованные набережные для неспешных прогулок &ndash; все&nbsp;к вашим услугам.

		
			&nbsp;
	



	&nbsp;


	Экскурсионные программы

	
		&nbsp;

	
		Зеленая поляна&nbsp; &laquo;Лесное&raquo; находиться&nbsp; 33 км &nbsp;от Северного речного вокзала Столицы на правом берегу Пестовского водохранилища. Эти живописные места, как нельзя лучше подходят для корпоративных праздников, тимбилдингов, деловых встреч без галстуков и, конечно же, теплых семейных торжеств.

	
		
			&nbsp;

		
			На территории&nbsp; для Вас и Ваших гостей:

		
			
				Большая благоустроенная охраняемая территория ;
			
				Хвойный бор &nbsp;с видом на канал им. Москвы ;
			
				Летние &nbsp;крытые&nbsp; веранды на 100 и 20 персон.
			
				Спортивные площадки; (футбольная, волейбольная,)настольный теннис.
			
				Песчаный пляж с &nbsp;кабинками для переодевания ;
			
				Площадка для пикника, мангал;
			
				Сцена &nbsp;
			
				причал для яхт и теплоходов;
			
				Электроэнергия и точки подключения
		
	

	
		Уверены, что &laquo;Лесное&raquo; не оставит Вас равнодушными!

	
		&nbsp;

	
		Экскурсионные программы



	&nbsp;

	Мышкин


	Самый симпатичный и трогательный городок на верхней Волге, он может быть рекомендован для поездок с детьми. &laquo;Мышиные палаты&raquo; приглашают всех в царство мышей и мышек. Старинная мельница, город мастеров, музеи льна и валенка, экспозиция&nbsp; &laquo;Древо жизни&raquo;. Время в этом городе пролетает незаметно для взрослых и детей. Обязательно нужно посетить необычный мемориал Победы, основанный на подлинных письмах Солдата Великой Отечественной, которые невозможно читать со спокойным сердцем.


	Полюбуйтесь панорамой Волги с откоса или с колокольни Успенского собора.


	&nbsp;


	Экскурсионные программы


	&nbsp;

	&nbsp;&nbsp;&nbsp; Павлово.


	Город расположен на правом берегу реки Оки на Перемиловских горах. Павлово, названное по легенде в честь перевозчика Павла - первого поселенца этих живописных мест, стало крупным центром художественных промыслов самого разного направления.&nbsp;


	&nbsp; Город Павлово особо известен своими промыслами, связанными с обработкой металлов. В экспозиции городского музея, расположенного на набережной в непосредственной близости от причала, представлены изделия художественного литья, ковки, слесарного производства, все это уникальной культурно-исторической и художественной ценности.


	&nbsp;


	Экскурсионные программы
	&nbsp;

	
		Старинное село Вознесенское, стоящее на высоком берегу Камы неподалеку от впадения в нее речки Сарапулки, известно с давних времен. Этот Прикамский край активно осваивали жители богатого Великого Новгорода, и в новгородских летописях поселение и опорный пункт здесь впервые упомянуты в записях начала XII века. Название &laquo;село Вознесенское что на речке Сарапулке&raquo; впервые упоминается в 1579 году. С 1707 года носит название &laquo;дворцовое село Сарапул&raquo;, а с 1780 года &ndash; уездный город Сарапул. Во второй половине XIX века &ndash; один из крупнейших в Российской Империи центров кожевенной и обувной промышленности.

	
		В 1941 году в Сарупул из Ленинграда были эвакуированы многие музейные ценности, в том числе из коллекции Эрмитажа. Рядом с городом на Каме были сняты некоторые эпизоды фильма &laquo;Волга-Волга&raquo;.

	
		Стоящий на высоком берегу Камы, город Сарапул является &laquo;речными воротами&raquo; Республики Удмуртия, куда прибывают туристы на теплоходах.&nbsp;
